    return (
      <SafeAreaView style={styles.container}>
        <View style={styles.logoContainer}>
          <Image 
            style={styles.logo} 
            source={require('../../../assets/favicon.png')}
          />
        </View>
      </SafeAreaView>
    );
  }

  const styles = StyleSheet.create({
    container: {
      paddingTop: 50,
      backgroundColor: '#F2F2F2',
    },
